def convert2int(img):

    if img.min() == 0:
        return img
    if img.dtype == "uint8":
        return img - 2**8 / 2
    elif img.dtype == "uint16":
        return img - 2**16 / 2
    elif img.dtype == "uint32":
        return img - 2**32 / 2
    else:
        return img

def get_max_parsimony_n_alleles(n, ploidy):

    remainder = n % ploidy
    if ploidy >= n:
        return ploidy
    elif remainder:
        return n + ploidy - remainder
    else:
        return n

