def correct_to_01(a, epsilon=1.0e-10):

    assert epsilon >= 0.0
    min_value = 0.0
    max_value = 1.0
    min_epsilon = min_value - epsilon
    max_epsilon = max_value + epsilon
    if a <= min_value and a >= min_epsilon:
        return min_value
    elif a >= max_value and a <= max_epsilon:
        return max_value
    else:
        return a

