def get_neighbours(x, y, thresh_shape):

    x_lim, y_lim = thresh_shape
    neighbours = []
    if x > 0:
        neighbours += [(x-1, y)]
    if y > 0:
        neighbours += [(x, y-1)]
    if y < (y_lim - 1):
        neighbours += [(x, y+1)]
    if x < (x_lim - 1):
        neighbours += [(x+1, y)]
    return neighbours

