def merge_two_intervals(interval_1, interval_2):

    intervals = sorted([interval_1, interval_2], key=lambda x: x[0])
    i1, i2 = intervals
    min1, max1 = i1
    min2, max2 = i2
    if max1 >= min2:
        return [[min(min1, min2), max(max1, max2)]]
    else:
        return [i1, i2]

