def chunk_it(seq, num):

    if num >= len(seq):
        num = len(seq)

    avg = len(seq) / float(num)
    out = []
    last = 0.0

    while last < len(seq):
        out.append(seq[int(last):int(last + avg)])
        last += avg

    return out

