def binary_search(arr, key):

    left = 0
    right = len(arr)-1
    while left <= right:
        mid = int(left + (right-left)/2)
        if arr[mid] == key:
            return mid
        elif arr[mid] < key:
            left = mid+1
        else:
            right = mid-1

    return -1

